import classes from "./Modal.module.css";

export default function Modal({ isOpen }) {
  return (
    <>
      <div className={classes.backdrop}></div>
      <dialog className={classes.modal} open={isOpen}>
        <header>Incorrect age format</header>
        <p></p>
      </dialog>
    </>
  );
}
